ty level <a class=\"anchor\" id=\"type_of_users_per_activity_level\"></a>\n","Since I don't have any demographic variables from our sample, I want to determine the type of users with the data we have. I can classify the users by activity based on their daily step counts as suggested by the link below. The categorization of users is as follows:\n","* Sedentary - Less than 5000 steps a day.\n","* Lightly active - Between  5000 and 7499 steps a day. \n","* Fairly active - Between 7500 and 9999 steps a day.\n","* Very active - More than 10000 steps a day. \n","\n","Classification has been performed as per the following article <https://www.10000steps.org.au/articles/counting-steps/>\n","\n","First, I will compute the daily average of steps per user. Let's get coding!"]},{"cell_type":"code","execution_count":15,"id":"5373217d","metadata":{"execution":{"iopub.execute_input":"2023-12-18T10:37:45.091266Z","iopub.status.busy":"2023-12-18T10:37:45.087064Z","iopub.status.idle":"2023-12-18T10:37:45.168264Z","shell.execute_reply":"2023-12-18T10:37:45.164718Z"},"papermill":{"duration":0.126533,"end_time":"2023-12-18T10:37:45.17246","exception":false,"start_time":"2023-12-18T10:37:45.045927","status":"completed"},"tags":[]},"outputs":[],"source":["daily_average <- daily_act_sleep %>%\n","  group_by(id) %>%\n","  summarise (mean_daily_steps = mean(totalsteps), mean_daily_calories = mean(calories), mean_daily_sleep = mean(totalminutesasleep))\n"]},{"cell_type":"markdown","id":"9fe99674","metadata":{"papermill":{"duration":0.036726,"end_time":"2023-12-18T10:37:45.256981","exception":false,"start_time":"2023-12-18T10:37:45.220255","status":"completed"},"tags":[]},"source":["Let me check my new data frame."]},{"cell_type":"code","execution_count":16,"id":"723939e8","metadata":{"execution":{"iopub.execute_input":"2023-12-18T10:37:45.340227Z","iopub.status.busy":"2023-12-18T10:37:45.337209Z","iopub.status.idle":"2023-12-18T10:37:45.392471Z","shell.execute_reply":"2023-12-18T10:37:45.3890