 calories burned, I want to understand how often the users in my sample use their device. That way, I can plan my marketing strategy and identify which features would benefit the use of smart devices.\n","\n","I will calculate the number of users who use their smart device on a daily basis, classifying my sample into three categories, knowing that the date interval is 31 days:\n","\n","High use: Users who use their device between 21 and 31 days.\n","Moderate use: Users who use their device between 10 and 20 days.\n","Low use: Users who use their device between 1 and 10 days.\n","First, I will create a new data frame by grouping by ID, calculating the number of days used, and creating a new column with the explained classification above."]},{"cell_type":"code","execution_count":35,"id":"44591458","metadata":{"execution":{"iopub.execute_input":"2023-12-18T10:37:52.767599Z","iopub.status.busy":"2023-12-18T10:37:52.765722Z","iopub.status.idle":"2023-12-18T10:37:52.790928Z","shell.execute_reply":"2023-12-18T10:37:52.788899Z"},"papermill":{"duration":0.071631,"end_time":"2023-12-18T10:37:52.793576","exception":false,"start_time":"2023-12-18T10:37:52.721945","status":"completed"},"tags":[]},"outputs":[],"source":["daily_use <- daily_act_sleep %>%\n","  group_by(id) %>%\n","  summarize(days_used=sum(n())) %>%\n","  mutate(usage = case_when(\n","    days_used >= 1 & days_used <= 10 ~ \"low use\",\n","    days_used >= 11 & days_used <= 20 ~ \"moderate use\", \n","    days_used >= 21 & days_used <= 31 ~ \"high use\", \n","  ))\n","  "]},{"cell_type":"markdown","id":"0b018ea2","metadata":{"papermill":{"duration":0.040923,"end_time":"2023-12-18T10:37:52.874514","exception":false,"start_time":"2023-12-18T10:37:52.833591","status":"completed"},"tags":[]},"source":["Let me quickly check."]},{"cell_type":"code","execution_count":36,"id":"7aa3f7b2","metadata":{"execution":{"iopub.execute_input":"2023-12-18T10:37:52.958762Z","iopub.status.busy":"2023-12-18T10:37:52.956889Z","iopub.sta